        super(props)
        this.state = {
            nom:'salma',
              note: 10     
        }
    }
    Changenote=()=>{
        this.setState({note:20})
    }
render(){
    return(
        <div>
            <h1>hello {this.state.nom} </h1>
            <h1>la note est :{this.state.note}</h1>
            <button onClick={this.Changenote}>Changer</button>
        </div>
